$(".animFade").each(function () {  
  gsap.to($(this), {
    scrollTrigger: {
      trigger: $(this),
      start: `top 100%`,
    },
    duration: 1,
    autoAlpha: 1,
    ease: "power1.out",
  });
});

$('.section-anim').each(function(){
  let $this = $(this); 
  ScrollTrigger.batch($this.find('.stagger'), {
    start: "top 90%",  
    interval: 0.15,
    onEnter: (batch) => {
      gsap.to(batch, {opacity: 1, y: 0, stagger: 0.15, overwrite: true})
    }
  })
});

$('.heading-wrapper').each(function(){
  let $this = $(this); 
  let tl  = gsap.timeline();
  tl.set($this, { visibility: "visible" });

  ScrollTrigger.create({
    trigger: $this,
    start: "top 90%",  
    once:true,
    onEnter: () => {
      tl.fromTo($this.find('.heading-line'), {scaleX: 0, transformOrigin: "left center"}, {scaleX: 1, duration: 1});
    }
  });
})


ScrollTrigger.create({
  trigger: ".header-main",
  start: "48px top",
  end: "100% 0%",
  endTrigger: "html",
  toggleClass: "active"
});


$(document).on("click", "[data-scrollto]", function(e) {
    e.preventDefault();
    var scrollToElm = $(this).data("scrollto");
    var scrollPos =
        $('[data-scroll-id="' + scrollToElm + '"]').offset().top -
        $(".header-main").outerHeight();
    $("html,body").stop().animate({
        scrollTop: scrollPos
    }, 700);
    $(".menu-active .h-active").trigger("click");
});


$(".menu-toggle").on("click", function(event) {
    $("body").toggleClass("menu-active");
});

$(".hamburger").on("click", function (event) {
  $(this).toggleClass("h-active");
  $("body").toggleClass("menu-active"); 
});

$('.card-count .number').each(function(){
  let count = $(this);
  let value = {val:0};
  let length;
  let tl = gsap.timeline({
    paused: true,
    scrollTrigger: {
      trigger: $(this),
    }
  });
  tl.to(value, {
    val: count.data('count'),
    duration: 1,
    onUpdate: () =>{
      if(count.data('count').toString().split('.')[1]){
        length = count.data('count').toString().split('.')[1].length
      }
      if(count.data('count').toString().split('.').length > 1){
        count.text(value.val.toFixed(length));
      }
      else{
        count.text(value.val.toFixed(0));
      }
    }
  });
});


function fullWidth() {
  var wWidth = ($(window).width() - $(".container-width").width()) / 2;
  $(".java-pl").css("padding-left", wWidth);
  $(".java-pr").css("padding-right", wWidth);
  $(".java-ml-n").css("margin-left", -wWidth);
  $(".java-mr-n").css("margin-right", -wWidth);

  $('.margin-minus').css({
    '--mn': -wWidth + 'px',
  })

}

fullWidth();

$(window).on("resize", function() {
  fullWidth();
});